import React, {Component} from 'react';
import { ListGroup, ListGroupItem, FormGroup, Input, Form, Button } from 'reactstrap';
import { BrowserRouter, Link } from "react-router-dom";







class NewsLetter  extends Component {


    render(){
        return(
            <div className="news_letter">
                <div className="container">
                    <BrowserRouter>
                        <Link className="thikdr_logo" to="#">
                            <img src="images/thikdr_logo.png" alt="Logo"/>
                        </Link>
                    </BrowserRouter>
                    <div className="news_letter_sec">
                        <h3 className="title font-weight-bold">Are you house contractor and looking for the customer ?</h3>
                        <Form className="news_from">
                            <FormGroup>
                                <Input
                                name="email"
                                placeholder="Your email Address..."
                                type="email"
                                />
                            </FormGroup>
                            <Button className="submit_btn">Submit</Button>
                        </Form>
                    </div>
                </div>
            </div>
        );
        
    }
}
export default  NewsLetter;
